    }

    componentDidMount(){
        console.log('created');
        axios('/wp-json/menus/v1/menus/main').then(res => {
            const Items = res.data.items.map((item) =>
                <li> <a href={item.url}>{item.title}</a></li>
            );
            this.setState({
                listItems : Items,
            })
        });
    }

    render() {
        console.log('render');
        return (
            <div class="topnav">
                <ul>
                    {this.state.listItems}
                </ul>
            </div>
        )
    }
}
